  { :title => "Music Studio Assistant Internship", :description => "Natalia has been coaching singers young & young at heart for nearly 40 years. Beginning in the 70s as general vocal music teacher in Blackstone, Millville, MA to the voice faculties of Dean College in Franklin, MA and Roger Williams University in Bristol, RI to present day here at One Voice. Hire her now!", :created_at => "2013-09-30 07:14:21", :updated_at => "2013-09-30 07:14:21", :cover_image_uid => "2013/09/30/00_13_58_809_chris_gig.jpeg", :genre => "Alternative", :location => "Seattle", :date => "2013-10-11 07:00:00", :user_id => 1 },
  { :title => "Live at The Underground Lounge", :description => "The Underground Lounge is a one night event to present great emerging talent local or regional to the Chicagoland area and to the greater community. Underground Lounge is a new bar and live music space dedicated to all genres of music 7 nights a week. The promoter is looking for 3-4 bands on this night of any genre who can draw 30+ in the Chicago market. \r\n\r\nThe first $50 that a band makes at the door goes to covering house sound. After that, the band keeps everything. $5 cover on weekdays, $7 on weekends. Load in is always at 7 PM.", :created_at => "2013-09-30 07:59:56", :updated_at => "2013-09-30 08:00:49", :cover_image_uid => "2013/09/30/01_00_49_510_gig_foto.jpg", :genre => "Rock", :location => "Chicago", :date => "2013-11-22 08:00:00", :user_id => 1 },
  { :title => "Mash It Up Media Presents Speakeasy Saturdays", :description => "Mash It Up Media is looking for local talent in the Los Angeles county area who would like to play Saturday nights at a local Woodland Hills Bar (Dirty Bull Tavern). The bar has a pretty good sound system +mixer (4 Yamahas & and 4 JBL +2 subs). This is an eclectic bar so are open to many different genres. The night goes on from 10-2 so about 3-4 bands a night preferably would be on the bill. Headliners get a portion of the bar while opening acts support and receive expsoure. If you happen to be an opener and have a good night, you could be asked to headline a future Saturday. \r\n\r\nThe Dirty Bull Tavern is becoming a spot for local artists of all sorts so if you are a comedian with a clever idea, a painter, fashion designer, musician...reach out to see if you'd be a good fit for the event. It's more than the money you should be seeking when working with Speakeasy Saturdays. The hosts want real artists who are interested in breathing music and art culture into a city that lacks that experience. They have an opportunity to really make some cool stuff happen and if you are interested it could be a lot of fun.", :created_at => "2013-09-30 08:05:09", :updated_at => "2013-09-30 08:06:01", :cover_image_uid => "2013/09/30/01_06_01_391_greenday2_2319069b.jpg", :genre => "Rock", :location => "Los Angeles", :date => "2013-10-26 07:00:00", :user_id => 3 },
  { :title => "Old Seattle Show", :description => "Old Seattle is looking for bands, artists/singers to perform at their venue in Detroit on November 18th.\r\n\r\nThey are looking for a diverse show, so you must show that you have a following online and can bring a solid draw to this venue.\r\n\r\nPlease note that there is no monetary compensation for this gig.", :created_at => "2013-09-30 08:08:12", :updated_at => "2013-09-30 08:08:12", :cover_image_uid => nil, :genre => "Rock", :location => "Seattle", :date => "2013-11-18 08:00:00", :user_id => 2 },
  { :title => "Monday Night Alternatives at DCBK 10/28", :description => "The “corner bar” is always the best neighborhood hangout and an integral part of the community. Darryl's Corner Bar & Kitchen is just that: the intersection of good friends, great food and live music. Owner Darryl Settles pours life back into the former Bob the Chef’s space with a sleek bar, exposed brick walls and sexy lighting that offers Roxbury, the South End and Back Bay the sophisticated social spot they’ve been craving. One of the few places in Boston to offer live jazz and R&B, DCBK hosts notable musicians six nights a week and would like to introduce Monday Alternatives! With its cool vibe, a friendly staff and late night menu, Darryl’s Corner Bar & Kitchen is a welcomed neighborhood mainstay.", :created_at => "2013-09-30 08:10:43", :updated_at => "2013-09-30 08:11:00", :cover_image_uid => "2013/09/30/01_11_00_683_ft_images.jpeg", :genre => "Alternative", :location => "New York", :date => "2013-10-28 07:00:00", :user_id => 4 },
  { :title => "Music Supervisors need music", :description => "Seeks: All Genres\r\nExplicit Lyrics Accepted: No\r\nInstrumentals Accepted: Yes (No Samples)\r\nCompensation: Royalties, Licensing, Placements\r\n\r\nDescription: Mac A Million Dollar Man Musick has secured thousands of placements, on various networks such as, NBC, CBS, FOX, MTV, CMT, TLC, BET, A&E, HBO, and VH1, just to name a few. They need good music for placements and licensing deals. They do approximately 30 pitches a week to music supervisors, and editors, for various games, films and TV shows, who all request a wide variety of genres. Please professional recordings only, no covers, no demos, or rough mixes. The songs must be all original, and 100% broadcast/retail ready!", :created_at => "2013-09-30 08:12:40", :updated_at => "2013-09-30 08:12:40", :cover_image_uid => nil, :genre => "Rock", :location => "Seattle", :date => "2014-01-04 08:00:00", :user_id => 1 },
  { :title => "Zydeco Nites", :description => "Every Sunday at Zydeco, Little Town Sound hosts an evening with 3 bands bringing the downtown brunch crowd to stay out through the evening with great drinks and great tunes.", :created_at => "2013-09-30 08:14:26", :updated_at => "2013-09-30 08:14:26", :cover_image_uid => nil, :genre => "Jazz", :location => "Seattle", :date => "2013-10-20 07:00:00", :user_id => 1 },
  { :title => "Rock On Philly Seeks Music for \"Die Hipster Die\" Soundtrack", :description => "The director of the film Die Hipster Die has approached Rock On Philly to help gather the hottest indie music for the film's soundtrack. This film will be shown at film festivals across the country and already has major distribution interest. While there is no payment for placement at this time, the promotional opportunity is a great one. Preference will be given to Philly-based artists. Seeking music of all styles but especially EDM & Dubstep and artists who are similar to the Yeah Yeah Yeah's, Hot Hot Heat, The Black Keys, Grimes, Magnetic Fields, and Heartless Bastards. Credit in the film will be given. This is a Non- Exclusive Opportunity.\r\n\r\nDie Hipster Die Synopsis\r\nDie Hipster Die is a new indie film currently being shot in Philadelphia with a projected 2014 release date. In the story, a hipster couple enrages a gypsy fortune teller, who promptly conjures a demon crusader for cool to wipe out their upcoming house party. It is up to Luke and Brea, the only non-hipsters in attendance, to save the day through fighting for their lives and the lives of America's youth.\r\n\r\nAbout Rock On Philly\r\nRock On Philly is an online music magazine dedicated to the Philadelphia music scene. Be sure to check them out at www.rockonphilly.com and on Facebook at facebook.com/rockonphilly. ", :created_at => "2013-09-30 08:17:03", :updated_at => "2013-09-30 08:17:03", :cover_image_uid => "2013/09/30/01_17_03_494_power_gig_six_string_guitarsmall.jpg", :genre => "Rock", :location => "Los Angeles", :date => "2013-11-02 07:00:00", :user_id => 5 },
  { :title => "Silverlake Lounge DJ Night", :description => "Friday October 18, 2013 is a dance night at The Silverlake Lounge.\r\n\r\nThe Silverlake Lounge is seeking 3-4 acts comprising of DJs and bands that make people want to get up and dance. Promoter will collect $5-$10 at door and pay out 70% to artists. Promoter has all necessary equipment including projectors so artists with light shows or visual media are encouraged.\r\n\r\nLocated on Sunset Boulevard, in Los Angeles, The Silverlake Lounge boasts a room capacity of 171 patrons and a history built upon epic shows.", :created_at => "2013-09-30 08:22:46", :updated_at => "2013-09-30 08:22:46", :cover_image_uid => nil, :genre => "Rock", :location => "Los Angeles", :date => "2013-10-18 07:00:00", :user_id => 5 },
  { :title => "Acoustic Patio Show", :description => "The Pine Creek Lodge is looking for acoustic Singer/Songwriters to perform for food, tips and merch sales (no guarentee at this time) on their patio each weekend Thurs-Sat. The typical crowd size is 20-50 people and it is a very intimate, relaxing, setting. A great venue to make quality fans. Venue is located in East Texas off Hwy 59 between I-10 and I-20. \r\n\r\nPine Creek Country Inn provides a beautiful and unique setting that meets a variety of needs. The facility is located 10 miles west of historic Nacogdoches - \"the oldest town in Texas.\" They are peacefully nestled in the midst of 25 acres which represents East Texas at its finest.", :created_at => "2013-09-30 08:31:18", :updated_at => "2013-09-30 08:31:18", :cover_image_uid => nil, :genre => "Alternative", :location => "Los Angeles", :date => "2013-12-07 08:00:00", :user_id => 2 },
  { :title => "Bernie's Sing Your Heart Out", :description => "The Metropolitan Room invites you to perform at \"Bernie's Sing Your Heart Out\" talent showcase with industry professionals. Whether you have been singing for several years or you're just starting out, The prestigious Metropolitan Room wants you to start your career with the best. Take the same stage that legends have performed on. This is an opportunity to show off your talent to casting directors, managers & agents and talent scouts for TV & film.\r\n\r\nAt the end of the show, you will receive a free high quality DVD or link of your performance. You are required to bring a minimum of 5 paying customers. Cover charge is $20 plus 2 beverage minimum. A house pianist will be provided and you can sing 2 songs for a total of 6-8 minutes.", :created_at => "2013-09-30 08:32:53", :updated_at => "2013-09-30 08:32:53", :cover_image_uid => nil, :genre => "Rock", :location => "New York", :date => "2013-11-09 08:00:00", :user_id => 2 }
